 import React from 'react';
 import Router  from 'next/router';
import {useQuery, useMutation} from '@apollo/react-hooks';
import {MY_CURRENTADDRESS } from '../../graphql/Profile';



 const CurrentAddress = () => {
     const {data, loading, error} = useQuery(MY_CURRENTADDRESS);
     console.log("User Current Address:", data)
     console.log("Loading:", loading)
     console.log("Error:", error)
     return (
         <div>
             <h3>Current Address:</h3>
             {
                 data.user. currentAddress === null ? <button onClick={() => Router.push('/profile/create')}>Add</button> :
                 <div>
                        <span>   Address1: {data.user.contact.type}</span><br/>
                        <span>   Address2: {data.user.contact.type}</span><br/>
                        <span>  ເບີໂທຕິດຕໍ: {data.user.contact.contactNo}</span><br/>
                        <span>  ອີເມວຫລັກ: {data.user.contact.conditionEmail1}</span><br/>
                        <span>  ອີເມວສຳຣ້ອງ: {data.user.contact.conditionEmail2}</span>
                 </div>
             }
         </div>
     )
 }

 export default CurrentAddress
